import React from "react";
import Flashcard from "../components/Flashcard";



state = {
  flashcards: [],
  flashcardName: "",
  flashcardImage: ""
};

loadFlashcard = () => {
  API.getFlashcard()
    .then(res =>
      this.setState({ flashcards: res.data, flashcardName: "", flashcardImage: "" })
    )
    .catch(err => console.log(err));
};
function materials() {
  return (
    <div>
      <h1>My flashcards</h1>
      <Flashcard flashcardWord="Hello" flashcardImage="https://i.redd.it/l13irykatoz11.jpg" >
      </Flashcard>
    </div>
  );
}

export default materials;
